import{_ as t,o as r,c as s,a as e,d as a,e as n,b as l,r as o}from"../app.b199fa92.mjs";const d={},c=n('<h1 id="multiple-linear-regression" tabindex="-1"><a class="header-anchor" href="#multiple-linear-regression" aria-hidden="true">#</a> Multiple Linear Regression</h1><p>\u0E40\u0E2B\u0E21\u0E37\u0E2D\u0E19 Linear Regression \u0E41\u0E15\u0E48\u0E21\u0E35\u0E2B\u0E25\u0E32\u0E22\u0E15\u0E31\u0E27\u0E41\u0E1B\u0E23</p><h2 id="assumptions-requirements" tabindex="-1"><a class="header-anchor" href="#assumptions-requirements" aria-hidden="true">#</a> Assumptions + Requirements</h2><ol><li>Linear relationship</li><li>Independence of error</li><li>Heterogeneity of residual</li><li>Normal Distribution of Residual</li><li>Absence of Multicollinearity (\u0E14\u0E49\u0E27\u0E22 VIF + Correlation)</li></ol><h2 id="tests" tabindex="-1"><a class="header-anchor" href="#tests" aria-hidden="true">#</a> Tests</h2><p>\u0E17\u0E33\u0E04\u0E25\u0E49\u0E32\u0E22 Simple Regression \u0E41\u0E15\u0E48\u0E21\u0E35\u0E01\u0E32\u0E23\u0E43\u0E2A\u0E48\u0E15\u0E31\u0E27\u0E41\u0E1B\u0E23\u0E40\u0E1E\u0E34\u0E48\u0E21\u0E40\u0E1E\u0E37\u0E48\u0E2D\u0E40\u0E17\u0E35\u0E22\u0E1A\u0E42\u0E21\u0E40\u0E14\u0E25 \u0E01\u0E14 next \u0E15\u0E23\u0E07\u0E17\u0E35\u0E48\u0E43\u0E2A\u0E48\u0E15\u0E31\u0E27\u0E41\u0E1B\u0E23\u0E15\u0E49\u0E19\u0E40\u0E1E\u0E34\u0E48\u0E21\u0E40\u0E15\u0E34\u0E21\u0E44\u0E14\u0E49 (\u0E2A\u0E23\u0E49\u0E32\u0E07 Model \u0E21\u0E32\u0E40\u0E17\u0E35\u0E22\u0E1A)</p><ol><li>Statistic \u0E40\u0E2B\u0E21\u0E37\u0E2D\u0E19\u0E40\u0E14\u0E34\u0E21 \u0E41\u0E15\u0E48\u0E40\u0E1E\u0E37\u0E48\u0E21</li><li>R square change, Descriptive, Part &amp; partial correlation, Collinearity diagnostics</li><li>\u0E44\u0E1B\u0E17\u0E35\u0E48 Save \u0E41\u0E25\u0E49\u0E27\u0E40\u0E25\u0E37\u0E2D\u0E01</li><li>Predicted Values (Unstandardized, Standardized, Adjust)</li><li>Residual (Standardized) Distances \u2192 \u0E40\u0E25\u0E37\u0E2D\u0E01\u0E17\u0E38\u0E01\u0E2D\u0E31\u0E19</li><li>Influence Statistics (Standardized DFFIT, DFFit)</li></ol><h2 id="reporting-the-result" tabindex="-1"><a class="header-anchor" href="#reporting-the-result" aria-hidden="true">#</a> Reporting the result</h2><p>\u0E2A\u0E23\u0E38\u0E1B\u0E1C\u0E25\u0E40\u0E2B\u0E21\u0E37\u0E2D\u0E19 Linear Regression \u0E15\u0E31\u0E27\u0E41\u0E1B\u0E23\u0E40\u0E14\u0E35\u0E22\u0E27 \u0E41\u0E15\u0E48\u0E21\u0E35\u0E08\u0E38\u0E14\u0E17\u0E35\u0E48\u0E15\u0E49\u0E2D\u0E07\u0E43\u0E2B\u0E49\u0E14\u0E39\u0E40\u0E1E\u0E37\u0E48\u0E21</p><p>\u0E42\u0E14\u0E22 VIF, Tolerance, Correlations between variable \u0E40\u0E2D\u0E32\u0E21\u0E32\u0E40\u0E1E\u0E37\u0E48\u0E2D\u0E17\u0E14\u0E2A\u0E2D\u0E1A Multicollinearity</p><p><strong>VIF (Variance inflation factor)</strong> \u0E15\u0E23\u0E27\u0E08 Multicollinearity \u0E1A\u0E2D\u0E01\u0E23\u0E30\u0E14\u0E31\u0E1A\u0E04\u0E27\u0E32\u0E21\u0E2A\u0E31\u0E21\u0E1E\u0E31\u0E19\u0E18\u0E4C\u0E02\u0E2D\u0E07\u0E15\u0E31\u0E27\u0E41\u0E1B\u0E23 Predictor</p><p>\u0E42\u0E14\u0E22\u0E04\u0E48\u0E32\u0E43\u0E01\u0E25\u0E49 1 = \u0E14\u0E35 \u0E41\u0E25\u0E30\u0E22\u0E2D\u0E21\u0E23\u0E31\u0E1A\u0E2A\u0E39\u0E07\u0E2A\u0E38\u0E14\u0E17\u0E35\u0E48 5</p><p>\u0E42\u0E14\u0E22\u0E15\u0E31\u0E27\u0E41\u0E1B\u0E23\u0E19\u0E31\u0E49\u0E19 \u0E2B\u0E49\u0E32\u0E21\u0E40\u0E1B\u0E47\u0E19\u0E41\u0E1A\u0E1A Ordinal \u0E40\u0E1E\u0E23\u0E32\u0E30\u0E44\u0E21\u0E48\u0E2A\u0E32\u0E21\u0E32\u0E23\u0E16\u0E23\u0E30\u0E1A\u0E38\u0E44\u0E14\u0E49 \u0E43\u0E0A\u0E49\u0E44\u0E14\u0E49\u0E41\u0E04\u0E48\u0E41\u0E1A\u0E1A\u0E17\u0E35\u0E48\u0E40\u0E1B\u0E47\u0E19 Continuous \u2192 \u0E43\u0E2B\u0E49\u0E43\u0E0A\u0E49 Correlations \u0E41\u0E17\u0E19</p><p><strong>Tolerance</strong> \u0E40\u0E2B\u0E21\u0E37\u0E2D\u0E19\u0E01\u0E31\u0E1A VIF \u0E42\u0E14\u0E22\u0E40\u0E2D\u0E32\u0E21\u0E32 inverse ( 1 / VIF ) \u0E2B\u0E32\u0E01\u0E04\u0E48\u0E32 &lt; 0.5 \u2192 \u0E21\u0E35\u0E1B\u0E31\u0E0D\u0E2B\u0E32</p><p><strong>Correlations between variables</strong> \u0E2B\u0E32\u0E01\u0E04\u0E48\u0E32\u0E40\u0E01\u0E34\u0E19 0.8 \u0E17\u0E31\u0E49\u0E07\u0E2A\u0E2D\u0E07\u0E1D\u0E31\u0E48\u0E07\u0E15\u0E31\u0E27\u0E41\u0E1B\u0E23 \u2192 \u0E21\u0E35 correlations \u0E23\u0E30\u0E2B\u0E27\u0E48\u0E32\u0E07\u0E15\u0E31\u0E27\u0E41\u0E1B\u0E23 \u2192 \u0E2A\u0E23\u0E49\u0E32\u0E07\u0E1B\u0E31\u0E0D\u0E2B\u0E32 Multicollinearity</p><p>\u0E15\u0E32\u0E23\u0E32\u0E07 Coefficients</p><p><img src="https://statistics.laerd.com/spss-tutorials/img/mr/table-coefficients-highlighted-b-only.png" alt=""></p><p>\u0E2D\u0E31\u0E19\u0E19\u0E35\u0E49\u0E01\u0E47\u0E40\u0E2B\u0E21\u0E37\u0E2D\u0E19 Simple Linear Regression \u0E41\u0E15\u0E48\u0E27\u0E48\u0E32\u0E2D\u0E31\u0E19\u0E17\u0E35\u0E48\u0E19\u0E48\u0E32\u0E2A\u0E19\u0E43\u0E08\u0E2D\u0E35\u0E01\u0E01\u0E47\u0E04\u0E37\u0E2D Standardized Coefficients \u0E17\u0E35\u0E48\u0E08\u0E30\u0E1A\u0E2D\u0E01\u0E27\u0E48\u0E32\u0E2D\u0E31\u0E19\u0E44\u0E2B\u0E19\u0E40\u0E1B\u0E47\u0E19\u0E15\u0E31\u0E27\u0E41\u0E1B\u0E23\u0E17\u0E35\u0E48\u0E19\u0E48\u0E32\u0E2A\u0E19\u0E43\u0E08 \u0E41\u0E25\u0E30\u0E2D\u0E18\u0E34\u0E1A\u0E32\u0E22 model \u0E44\u0E14\u0E49\u0E21\u0E32\u0E01\u0E17\u0E35\u0E48\u0E2A\u0E38\u0E14 (\u0E14\u0E39\u0E04\u0E48\u0E32 Beta \u0E41\u0E25\u0E49\u0E27\u0E44\u0E21\u0E48\u0E15\u0E49\u0E2D\u0E07\u0E2A\u0E19\u0E43\u0E08 magnitude) \u0E40\u0E0A\u0E48\u0E19\u0E2D\u0E31\u0E19\u0E19\u0E35 gender \u0E2A\u0E33\u0E04\u0E31\u0E0D\u0E2A\u0E38\u0E14</p><p>\u0E42\u0E14\u0E22\u0E17\u0E35\u0E48\u0E1A\u0E2D\u0E01\u0E44\u0E14\u0E49\u0E27\u0E48\u0E32\u0E2B\u0E32\u0E01 gender \u0E40\u0E1B\u0E25\u0E35\u0E48\u0E22\u0E19\u0E44\u0E1B \u0E08\u0E30\u0E17\u0E33\u0E43\u0E2B\u0E49\u0E15\u0E31\u0E27\u0E41\u0E1B\u0E23\u0E15\u0E32\u0E21\u0E40\u0E1B\u0E25\u0E35\u0E48\u0E22\u0E19\u0E44\u0E1B 13.208 \u0E2B\u0E19\u0E48\u0E27\u0E22 (\u0E43\u0E2B\u0E49\u0E14\u0E39\u0E04\u0E48\u0E32 Unstandardised Coefficient B)</p><p>\u0E40\u0E02\u0E35\u0E22\u0E19\u0E2A\u0E23\u0E38\u0E1B</p><ul><li>A multiple regression was run to predict VO2max from gender, age, weight and heart rate.</li><li>These variables statistically significantly predicted VO2max, <em>F</em>(4, 95) = 32.393, <em>p</em> &lt; .0005, <em>R**2</em> = .577.</li><li>All four variables added statistically significantly to the prediction, <em>p</em> &lt; .05.</li><li>\u0E41\u0E21\u0E49\u0E27\u0E48\u0E32\u0E04\u0E48\u0E32 R^2 \u0E08\u0E30\u0E19\u0E49\u0E2D\u0E22 \u0E41\u0E15\u0E48\u0E15\u0E31\u0E27\u0E41\u0E1B\u0E23\u0E17\u0E35\u0E48\u0E44\u0E14\u0E49\u0E21\u0E32\u0E19\u0E31\u0E49\u0E19\u0E21\u0E35\u0E04\u0E27\u0E32\u0E21\u0E2A\u0E31\u0E21\u0E1E\u0E31\u0E19\u0E18\u0E4C\u0E40\u0E0A\u0E34\u0E07\u0E2A\u0E16\u0E34\u0E15\u0E34</li></ul><hr><p>Reference</p>',23),p={href:"https://statistics.laerd.com/spss-tutorials/multiple-regression-using-spss-statistics.php",target:"_blank",rel:"noopener noreferrer"},u=l("https://statistics.laerd.com/spss-tutorials/multiple-regression-using-spss-statistics.php");function h(m,g){const i=o("ExternalLinkIcon");return r(),s("div",null,[c,e("ul",null,[e("li",null,[e("a",p,[u,a(i)])])])])}const _=t(d,[["render",h],["__file","index.html.vue"]]);export{_ as default};
